//       <Calendar />
//     </div>
//   )
// }

const router = createBrowserRouter([
  {path:'/',
  element: (<Calendar />),
  errorElement: (<Notfound />)
  },
  {path:'/todo/:date/:month/:year',
  element: (<Todo />)
  },
  {path:'/article/:number',
  element: (<Article />)
  }
])

const App = () => <RouterProvider router={router}/>;
export default App;


